import React, { useState } from "react";
import { Routes, BrowserRouter as Router, Route } from "react-router-dom";
import "./App.css";
import Nav from "./Nav";

function App() {
  const [value, setValue] = useState(undefined);
  function onChange(e) {
    setValue(e.target.value);
  }
  return (
    <div>
      <Nav value={value} onChange={onChange} />
    </div>
  );
}

export default App;
